pragma solidity ^0.4.24;

contract DMV{

	//Store current user address when page was loaded
    address public owner;
    
    constructor() public{
        owner = msg.sender;
    }
    
	//Check if current address from METAMASK is the original owner address
    modifier onlyBy(address _account)
    {
        require(msg.sender == _account, "Sender not authorized.");
        // Do not forget the "_;"! It will
        // be replaced by the actual function
        // body when the modifier is used.
        _;
    }
    
	//Defined Structs
    struct AccountStruct{
       string userInfo;
       string loginHashCheck;
	   string testGrades;
	   string realID;
	   bool isCreated;
    }
	
	uint8 numberofAccounts;
	uint8 carTitleCount;
    
    struct LoginStruct{
       string driverLicense;
    }
	
	struct VitalRecordRequestStruct{
       string[] requestInfo;
	   uint8 requestCount;
    }
	
	struct SoldVehicleReceiptStruct{
       string[] soldVehicleInfo;
	   uint8 soldVehicleCount;
	   string soldVehicleCarTitles;
    }
	
	struct ReportVehicleStruct{
       string[] reportVehicleInfo;
	   uint8 reportVehicleCount;
    }
	
	struct CarTitleStruct{
       string fullCarTitleInformation;
    }
	
    //Defined mappings
    mapping(address => LoginStruct) activeLogins;
    mapping(string => AccountStruct) allAccounts;
	mapping(string => VitalRecordRequestStruct) allVitalRecordRequests;
	mapping(string => SoldVehicleReceiptStruct) allSoldVehicleReceipts;
	mapping(string => ReportVehicleStruct) allReportedVehicles;
	mapping(string => CarTitleStruct) allCarTitles;
	
    //Create an account for current user address with their driver license as a key to lookup their information
    function createAccount(string memory _driverLicense,string memory _userInfo,string memory _loginHashCheck, string memory _testGrades) public{
	   
	    require(
            allAccounts[_driverLicense].isCreated == false,
            "Account already exists"
        );
		
    	allAccounts[_driverLicense].userInfo = _userInfo;
    	allAccounts[_driverLicense].testGrades = _testGrades;
    	allAccounts[_driverLicense].loginHashCheck = _loginHashCheck;
		allAccounts[_driverLicense].isCreated = true;
		activeLogins[msg.sender].driverLicense = _driverLicense;
		numberofAccounts+=1;
    }
    
	//Get user with current address's license account information by getting their logged in license number
    function getAccount() public view returns(string memory,string memory,string memory,string memory)  {
        string memory license = getLogin();
        if(!compareStrings(license, "")){
            return (allAccounts[license].userInfo,allAccounts[license].testGrades,allAccounts[license].realID,allAccounts[license].loginHashCheck);
        }
        else{
            return ("","","","");
        }
    }
	
	//Get Number of accounts
    function getNumberofAccounts() public view returns(uint8)  {
        return numberofAccounts;
    }
	
	//Update current address's license account information by getting their logged in license number
	function updateAccount(string memory _userInfo,string memory _testGrades, string memory _realID) public{
	   
	    string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
		if(!compareStrings( _userInfo, "")){
			allAccounts[license].userInfo = _userInfo;
		}
		if(!compareStrings(_testGrades, "")){
			allAccounts[license].testGrades = _testGrades;
		}
		if(!compareStrings(_realID, "")){
			allAccounts[license].realID = _realID;
		}
    }
	
	
    //Verify login credentials and then set logged in driver license as specified driver license 
    function Login(string memory _driverLicense, string memory _loginHashCheck, address _currentaddress) public{
		require(
            compareStrings(allAccounts[_driverLicense].loginHashCheck, _loginHashCheck),
            "Login Info is incorrect. Please Try again"
        );
		activeLogins[msg.sender].driverLicense = _driverLicense;
    }
    
	//Get logged in driver license. Used in all functions to get current user credentials
    function getLogin() public view returns(string memory){
    	return activeLogins[msg.sender].driverLicense;
    }
    //Set logged in driver license to empty string
    function Logout() public{
    	activeLogins[msg.sender].driverLicense = "";
    }
    
    //Used to compare if string are equal por not
    function compareStrings (string memory a, string memory b) public view returns (bool) {
            if(bytes(a).length != bytes(b).length) {
				return false;
			} else {
				return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))) );
			}

       }
	  
	  
	//Create vital record request with current address's license account information by getting their logged in license number
	function createVitalRecordRequest(string memory _requestInfo) public {
	
		string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
	
		allVitalRecordRequests[license].requestInfo.push(_requestInfo);
		allVitalRecordRequests[license].requestCount+=1;
	}
	
	//Get vital record request by index with current address's license account information by getting their logged in license number
	function getRecordRequestIndex(uint8 _index) public view returns(string memory)  {
        string memory license = getLogin();
		
		require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
        return (allVitalRecordRequests[license].requestInfo[_index]);
    }
	
	//Get vital record request count with current address's license account information by getting their logged in license number
	function getRecordRequestCount() public view returns(uint8)  {
        string memory license = getLogin();
		
		require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
        return (allVitalRecordRequests[license].requestCount);
    }
	
	//Create sold vehicle receipt with current address's license account information by getting their logged in license number
	function createSoldVehicleReceipt(string memory _soldVehicleInfo, string memory _soldVehicleCarTitles,string memory _fullCarTitleInformation) public {
	
		string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
	
		allSoldVehicleReceipts[license].soldVehicleInfo.push(_soldVehicleInfo);
		allSoldVehicleReceipts[license].soldVehicleCount+=1;
		allSoldVehicleReceipts[license].soldVehicleCarTitles = _soldVehicleCarTitles;
		allCarTitles[license].fullCarTitleInformation = _fullCarTitleInformation;
	}
	
	//Get sold vehicle receipt with current address's license account information by getting their logged in license number
	function getSoldVehicleReceiptIndex(uint8 _index) public view returns(string memory)  {
        string memory license = getLogin();
		require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
        return (allSoldVehicleReceipts[license].soldVehicleInfo[_index]);
    }
	
	//Get sold vehicle receipt count with current address's license account information by getting their logged in license number
	function getSoldVehicleReceiptCountAndCarTitles() public view returns(uint8,string memory)  {
        string memory license = getLogin();
		require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
        return (allSoldVehicleReceipts[license].soldVehicleCount,allSoldVehicleReceipts[license].soldVehicleCarTitles);
    }
	
	//Create reported vehicle with current address's license account information by getting their logged in license number
	function createReportedVehicle(string memory _reportVehicleInfo,string memory _soldVehicleCarTitles) public {
	
		string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
	
		allReportedVehicles[license].reportVehicleInfo.push(_reportVehicleInfo);
		allReportedVehicles[license].reportVehicleCount+=1;
		allSoldVehicleReceipts[license].soldVehicleCarTitles = _soldVehicleCarTitles;
	}
	
	//Get reported vehicle by index with current address's license account information by getting their logged in license number
	function getReportedVehicleIndex(uint8 _index) public view returns(string memory)  {
        string memory license = getLogin();
		
		require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
        return allReportedVehicles[license].reportVehicleInfo[_index];
    }
	
	//Get reported vehicle count with current address's license account information by getting their logged in license number
	function getReportedVehicleCount() public view returns(uint8)  {
        string memory license = getLogin();
		
		require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
        return allReportedVehicles[license].reportVehicleCount;
    }
	
	//Create car title with current address's license account information by getting their logged in license number
	function createCarTitleInformation(string memory _fullCarTitleInformation) public {
	
		string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
		allCarTitles[license].fullCarTitleInformation = _fullCarTitleInformation;
		carTitleCount += 1;
	}
	
	//Update car title with current address's license account information by getting their logged in license number
	function updateCarTitleInformation(string memory _fullCarTitleInformation) public {
	
		string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
		allCarTitles[license].fullCarTitleInformation = _fullCarTitleInformation;
	}
	
	//Get car title with current address's license account information by getting their logged in license number
	function getCarTitleInformation() public view returns(string memory,uint8){
	
		string memory license = getLogin();
	   
	    require(
            !compareStrings(license, ""),
            "Account for current address logged in could not be found"
        );
		
		return (allCarTitles[license].fullCarTitleInformation,carTitleCount);
	}

}
